//Creates a copy of the data if it deos not exist
//in the session variable. Run at the top of every function
//to Guerantee session data exists.
function setup(){
    global $staticData;
    if (session_status() == PHP_SESSION_NONE) {
        session_start();
    }
   
   if(!isset($_SESSION["dataArray434"])){
       $_SESSION["dataArray434"] = $staticData;
   }
}

//Copies subset of fields for the forcast table
function getForecast(){
    setup(); //guarantees data exists;
    $table = array();
    foreach($_SESSION["dataArray434"] as $row){
     array_push($table,array("Year"=>$row["Year"],"Month"=>$row["Month"],"Day"=>$row["Day"],"Forecast"=>$row["Forecast"]));
     
     
    }
    return $table;
}
//Copies subset of fields for the forcast table
function getSpecificForecast($forecast){
    setup(); //guarantees data exists;
    $table = array();
    foreach($_SESSION["dataArray434"] as $row){
        if($row["Forecast"] == $forecast){
            array_push($table,array("Year"=>$row["Year"],"Month"=>$row["Month"],"Day"=>$row["Day"],"Forecast"=>$row["Forecast"]));
        }
    }
    return $table;
}

function getSpecificMonth($month){
    setup(); //guarantees data exists;
    $table = array();
    foreach($_SESSION["dataArray434"] as $row){
        if($row["Month"] == $month){
            array_push($table,array("Year"=>$row["Year"],"Month"=>$row["Month"],"Day"=>$row["Day"],"Forecast"=>$row["Forecast"]));
        }
    }
    return $table;
}

//Get the row for the given date, otherwise return null if the day does not exist.
function getDay($year, $month, $day){
    setup();
    foreach($_SESSION["dataArray434"] as $row){
        //Lazy, using linear search
        if($row["Year"]==$year && $row["Month"]==$month && $row["Day"]==$day){
            return $row;
        }
    }
    return null;
}

//returns true if date has been changed, otherwise return false
function setForecast($year, $month, $day, $forecast){
    setup();
    foreach($_SESSION["dataArray434"] as $row){
        //Lazy, using linear search
        if($row["Year"]==$year && $row["Month"]==$month && $row["Day"]==$day){
            $row["Forecast"] = $forecast;
            return true;
        }
    }
    return false;
}

